/**
* @details 
*          This is the routine which frees the mac counters entry.
*/
void free_radioHeadStatusTable(void)
{
  radioHeadStatusTableEntry  * current = radioHeadStatusTable_head;

  if (current) 
  {
  for (current = radioHeadStatusTable_head->next ; current != NULL; current = current->next) {
    SNMP_FREE( current );  
    }
  }
   
  SNMP_FREE(radioHeadStatusTable_head);
  radioHeadStatusTable_head = NULL;

  return;
}


